import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Navbar from "./Navbar/Navbar";

function App() {
  return (
    <div className="container">
      <div className="navbar-holder">
        <Navbar />
      </div>
      <div className="navbar-holder">
        <h2>
          <p>Insert navbar: About, Timeline, Portfolio </p>
        </h2>
      </div>
      <div>
        <h3 className="info-holder">
          <p> Insert </p>
        </h3>
      </div>
    </div>
  );
}

export default App;
